Alice in Wonderland: An X-Rated Musical Fantasy (1976)

Director: Bud Townsend
Producer: William Osco
Music: Bucky Searles
Alice: Kristine DeBell
The White Rabbit: Larry Gelman
Mad Hatter: Alan Novak
Queen of Hearts: Juliet Graham

Alice offends her would-be lover William by rejecting his advances. Upset, she falls asleep reading Alice in Wonderland. The White Rabbit appears to her in a dream and takes her into a sexual wonderland. The story loosely follows Carroll's original plot, and includes many of its characters, but with considerable sexual license.

This is a fully-restored edition of the XXX (hardcore) version of this classic porn musical.

